package Strings;

// import java.util.HashMap;
import java.util.*;

public class Anagram {

    public static void main(String args[]) {

        String s = "";
        String t = "";

        // String s = "abcabcabc";
        // String t = "bcabcabca";

        if (s.length() != t.length())
            System.out.println("----The answer is false---as the lengths does not matches");

        HashMap<Integer, Integer> sHashMap = new HashMap<>();
        HashMap<Integer, Integer> tHashMap = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            sHashMap.put((int) s.charAt(i), (sHashMap.getOrDefault((int) s.charAt(i), 0)) + 1);
            System.out.println("The current value for s of " + s.charAt(i) + " is " + sHashMap.get((int) s.charAt(i)));
            tHashMap.put((int) t.charAt(i), (tHashMap.getOrDefault((int) t.charAt(i), 0)) + 1);
            System.out.println("The current value for t of " + t.charAt(i) + " is " + sHashMap.get((int) s.charAt(i)));
        }

        for (int i = 0; i < 26; i++) {
            System.out.println("for s we have put " + sHashMap.get(i + 97) + " at " + (i + 97));
            System.out.println("for t we have put " + tHashMap.get(i + 97) + " at " + (i + 97));
            if (sHashMap.get(i + 97) != tHashMap.get(i + 97)) {
                System.out.println(sHashMap.get(i + 97) + "---value when the conditions breaks for s");
                System.out.println(tHashMap.get(i + 97) + "---value when the conditions breaks for t");
                // System.out.println(tHashMap.get(i+97));
                System.out.println(
                        "The answer is false because the characters does not matches--------------- for i = " + i);
                break;
            }
        }

        System.out.println("The answer is true");

    }

}